import React from 'react';
import Header from './Header';
import Navigation from './Navigation';
import FormContainer from './FormContainer';
import ResultContainer from './ResultContainer';
import '../styles.css';

function App() {
  return (
    <div>
      <Header />
      <Navigation />
      <main>
        <FormContainer />
        <ResultContainer />
      </main>
    </div>
  );
}

export default App;
